import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import { Route , withRouter} from 'react-router-dom';


const styles = {
    newhover: {
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        opacity: 0,
        background: 'red',
        position: 'absolute',
        transition: 'opacity 250ms cubic-bezier(0.4, 0, 0.2, 1) 0ms',
    },
  };

class CardA extends Component {
    constructor(props){
        super(props);
        this.redirect=this.redirect.bind(this)
      }

      redirect(){
        this.props.history.push('/Project/ProjectA');
          }

  render() {
    return (
      <Grid item xs={12} sm={3} md={3}>
        <div className="section" className="hvr-sweep-to-top">
          <Card>
            <CardActionArea onClick={this.redirect} >
              <CardMedia
                className="card"
                image={require("./color4.png")}
                title="Shibaaaaaa"
              />
              <CardContent >
                <Typography gutterBottom variant="h5" component="h2">
                  Project 1
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                  The Shiba Inu is a Japanese breed of hunting dog. A small,
                  agile dog that copes very well with mountainous terrain, the
                  Shiba Inu was originally bred for hunting.
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        </div>
      </Grid>
    );
  }
}

export default withRouter(CardA);
